import { API, SuspenseGet, wrapPromise } from 'utils/api';

export const fetchUserProfile = ({ userId, jwt }) =>
	SuspenseGet({
		url: `web/profile/${userId}`,
		headers: {
			'x-access-token': jwt,
		},
	});

export const fetchUserResume = ({ userId, jwt }) =>
	SuspenseGet({
		url: `/web/profile/${userId}/resume`,
		headers: {
			'x-access-token': jwt,
		},
	});

